import React from "react";
import style from "./product.module.css";

const Product = () => {
  return (
    <div className={style.container}>
      <span className={style.category}>카테고리</span>
      <span className={style.image}>이미지</span>
      <span className={style.Product_name}>제품이름</span>
      <span className={style.expiration_date}>유통기한</span>
      <button className={style.delete}>삭제</button>
    </div>
  );
};

export default Product;
